('877', 'K', '74', '749', '7499', '74990', '5', 'Jasa Perusahaan yang Tidak Dapat Diklasifikasikan Di Tempat Lain', 'Meliputi usaha jasa kegiatan lainnya yang tidak dapat diklasifikasikan di tempat lain, seperti: jasa stenografi, jasa pelelangan, jasa penterjemaah, jasa penjawab telepon (telepone answering). Jasa foto kopi dan sebagainya.'),
('878', 'L', NULL, NULL, NULL, NULL, '1', 'ADMINISTRASI PEMERINTAHAN, PERTAHANAN DAN JAMINAN SOSIAL WAJIB', NULL),
('879', 'L', '75', NULL, NULL, NULL, '2', 'ADMINISTRASI PEMERINTAHAN, PERTAHANAN DAN JAMINAN SOSIAL WAJIB', NULL),
('880', 'L', '75', '751', NULL, NULL, '3', 'ADMINISTRASI PEMERINTAHAN, DAN KEBIJAKSANAAN EKONOMI DAN SOSIAL', NULL),
('881', 'L', '75', '751', '7511', NULL, '4', 'Kegiatan Pemerintahan Umum', NULL),
('882', 'L', '75', '751', '7512', '75122', '5', 'Pembinaan kesehatan  ', 'Meliputi kegiatan pemerintah dalam pembinaan kesehatan yang mempunyai kewajiban memberikan pengarahan, pertimbangan, dan mengambil keputusan dalam bidang pelayanan kesehatan, pengadaan obat-obatan, kesehatan masyarakat dan pencegahaan penyakit, termasuk p'),
('883', 'L', '75', '751', '7512', '75123', '5', 'Pembinaan Perumahan dan Lingkungan Hidup', 'Meliputi kegiatan pemerintahan dalam pembinaan sarana dan prasarana tempat tinggal yang memenuhi syarat perumahan, seperti: kebersihan keindahan, dan kelestarian lingkungan, dengan tujuan menjadikan masyarakat yang sehat dan sejahtera.'),
