('1320', 'D', '26', '261', '2612', '26122', '5', 'Industri Alat-alat Laboratorium, Farmasi dan Kesehatan dari gelas', 'Meliputi usaha pembuatan macam-macam alat laboratorium, farmasi dan kesehatan dari gelas, seperti: botol serum/ infus, ampul, tabung uji, tabung ukur,kaca sorong mikroskop, cuvent, dan dessicator.'),
('1321', 'D', '26', '261', '2612', '26123', '5', 'Industri Barang Gelas Untuk Keperluan Sampul', 'Meliputi usaha pembuatan macam-macam barang gelas untuk keperluan sampul, seperti: tabung gambar televisi, katup elektronik, dan tabung lampu.'),
('1322', 'D', '26', '261', '2612', '26124', '5', 'Industri Kemasan dari Gelas', 'Meliputi usaha pembuatan macam-macam barang untuk kemasan dari gelas, seperti: botol dan guci.'),
('1323', 'D', '26', '261', '2612', '26129', '5', 'Industri Barang-barang lainnya dari Gelas', 'Meliputi usaha pembuatan macam-macam barang -barang dari gelas yang belum tercakup dalam kelompok 26121 s.d 26124 seperti: tasbih, rosario, manik gelas, gelas enamel, dan aquarium. Termasuk juga usaha pembuatan bahan bangunan dari gelas seperti: bata, ubi'),
('1324', 'D', '26', '262', NULL, NULL, '3', 'INDUSTRI BARANG-BARANG DARI PORSELIN', NULL),
('1325', 'D', '26', '262', '2620', NULL, '4', 'Industri Barang-barang dari Porselin', NULL),
('1326', 'D', '26', '262', '2620', '26201', '5', 'Industri Perlengkapan Rumah Tangga dari Porselin', 'Meliputi usaha pembuatan macam-macam pelengkapan rumah tangga dari porselin seperti: piring, tatakan, cangkir, mangkok, teko, sendok, dan asbak. Termasuk juga usaha pembuatan barang pajangan dari porselin seperti: patung, tempat bunga, kotak rokok dan guc'),
('1327', 'D', '26', '262', '2620', '26202', '5', 'Industri Bahan Bangunan dari Porselin', 'Meliputi usaha pembuatan macam-macam bahan bangunan dari porselin seperti: kloset, bidet, wastafel, urinoir, bak cuci, bak mandi dan ubin.'),
('1328', 'D', '26', '262', '2620', '26203', '5', 'Industri Alat Laboratorium dan Alat Listrik/Teknik dari Porselin', 'Meliputi usaha pembuatan macam-macam alat laboratorium, listrik dan teknik serta perlengkapan dari porselin seperti: lumpang dan alu, piring penapis, tabung kimia, botol/guci, cawan, rumah sekering, insulator, isolator tegangan rendah dan isolator teganga'),
('1329', 'D', '26', '262', '2620', '26209', '5', 'Industri Barang-barang Lainnya dari Porselin', 'Meliputi usaha pembuatan macam-macam barang dari porselin yang belum tercakup dalam kelompok 26201 sampai dengan 26203.'),
('1330', 'D', '26', '263', NULL, NULL, '3', 'INDUSTRI PENGOLAHAN DARI TANAH LIAT', NULL),
('1331', 'D', '26', '263', '2631', NULL, '4', 'Industri Barang-Barang dari Tanah Liat / Keramik Tahan Api', NULL),
('1332', 'D', '26', '263', '2631', '26311', '5', 'Industri Bata Tahan Api dan Sejenisnya', 'Meliputi usaha pembuatan macam-macam bata tahan api dan mortar tahan api, seperti : alumina, silica dan basic.'),
('1333', 'D', '26', '263', '2631', '26319', '5', 'Industri Barang-Barang Tahan Api Lainnya dari Tanah Liat / Keramik Lainnya', 'Meliputi usaha pembuatan macam-macam barang tahan api, selain bata tahan api.'),
('1334', 'D', '26', '263', '2632', NULL, '4', 'Industri Barang-Barang dari Tanah Liat / Keramik, Selain Barang Tanah Liat Tahan Api', NULL),
('1335', 'D', '26', '263', '2632', '26321', '5', 'Industri Barang-Barang dari Tanah Liat Untuk Keperluan Rumah Tangga', 'Meliputi usaha pembuatan macam-macam barang dari tanah liat untuk perlengkapan rumah tangga, pajangan/hiasan, dan sejenisnya, seperti: piring, cangkir, mangkok, kendi, teko, periuk, tempayan, patung, vas bunga, tempat sirih, kotak, sigaret, dan celengan.'),
('1336', 'D', '26', '263', '2632', '26322', '5', 'Industri Batu Bata dari Tanah Liat', 'Meliputi usaha pembuatan macam-macam batu bata, seperti: bata pres, bata berongga, bata hiasan, bata bukan pres, dan bata lubang. Termasuk juga pembuatan semen merah dan kerikil tanah liat.'),
('1337', 'D', '26', '263', '2632', '26323', '5', 'Industri Genteng dari Tanah Liat', 'Meliputi usaha pembuatan macam-macam genteng, seperti: genteng pres, genteng biasa, genteng kodok, dan genteng yang diglazur.'),
('1338', 'D', '26', '263', '2632', '26324', '5', 'Industri Bahan Bangunan dari Tanah Liat Selain Batu Bata dan Genteng', 'Meliputi usaha pembuatan barang dari tanah liat untuk keperluan bahan selain batu bata dan genteng, seperti: kloset, saluran air, ubin, lubang angin dan buis (cincin untuk sumur).'),
('1339', 'D', '26', '263', '2632', '26329', '5', 'Industri Barang Lainnya dari Tanah Liat', 'Meliputi usaha pembuatan macam-macam barang lainnya dari tanah liat yang belum tercakup dalam kelompok 26321 s.d 26324.'),
('1340', 'D', '26', '264', NULL, NULL, '3', 'INDUSTRI SEMEN, KAPUR, DAN GIPS', NULL),
('1158', 'D', '19', '191', '1912', '19113', '5', 'Industri Kulit Buatan / Imitasi', 'Meliputi usaha pembuatan kulit buatan atau kulit imitasi baik dengan media selain tekstil maupun tanpa media yang dibuat dari bahan poly vynil chlorida (PVC), poly urethane (PU) dan atau dari bahan lainnya, seperti: kulit buatan atau imitasi dalam bentuk '),
('1159', 'D', '19', '191', '1912', NULL, '4', 'Industri Barang dari Kulit dan Kulit Buatan, Kecuali Untuk Alas Kaki', NULL),
('1160', 'D', '19', '191', '1912', '19121', '5', 'Industri Barang dari Kulit dan Kulit Buatan, Untuk keperluan Pribadi', 'Meliputi usaha pembuatan barang-barang dari kulit dan kulit buatan untuk keperluan pribadi, seperti: kopor, rasel, tas, dompet, kotak rias, sarung tangan olah raga, sarung senjata, tempat kaca mata, tali jam, topi, ikat pinggang dan dasi. '),
('1161', 'D', '19', '191', '1912', '19122', '5', 'Industri Pakaian Jadi dari Kulit dan kulit Buatan', 'Meliputi usaha pembuatan pakaian jadi dari kulit dan kulit buatan, seperti: jaket rok, celana, rompi, dan over coat / mantel.'),
('1245', 'D', '24', '241', '2411', NULL, '4', 'Industri Kimia Dasar , Kecuali Pupuk.   ', NULL),
('1246', 'D', '24', '241', '2411', '24111', '5', 'Industri Kimia Dasar Anorganik, Khlor dan Alkali', 'Meliputi usaha industri kimia dasar yang menghasilkan bahan kimia khlor dan alkali, seperti: soda kostik, soda abu, natrium khlorida, kalium hidrosida, dan senyawa khlor lainnya. Termasuk juga usaha industri yang menghasilkan logam alkali, seperti: lithiu'),
('1247', 'D', '24', '241', '2411', '24112', '5', 'Industri  Kimia Dasar Anorganik, Gas Industri', 'Meliputi usaha industri kimia dasar yang menghasilkan bahan kimia gas industri, seperti: zat asam, zat lemas, zat asam arang, amoniak dan dry ice. Termasuk juga usaha industri kimia dasar yang menghasilkan gas-gas mulia, seperti: helium, neon, argon dan r'),
('1248', 'D', '24', '241', '2411', '24113', '5', 'Industri  Kimia Dasar Anorganik, Pigmen', 'Meliputi usaha industri kimia dasar yang menghasilkan bahan anorganik pigmen seperti: meni merah, chrome yellow, zinc yellow, barium sulphte, pigmen serbuk almunium, oker dan pigmen dengan dasar titanium.'),
('1249', 'D', '24', '241', '2411', '24114', '5', 'Industri  Kimia Dasar Anorganik yang Tidak Diklasifikasikan di Tempat Lain', 'Meliputi usaha industri kimia dasar yang anorganik yang belum tercakup dalam golongan industri kimia dasar anorganik diatas, seperti: fosfor dengan turunannya, belerang dengan turunannya, nitrogen dengan turunannya. Termasuk juga industri kimia dasar yang'),
('1250', 'D', '24', '241', '2411', '24115', '5', 'Industri Kimia Dasar Organik, Bahan Kimia dari Kayu dan Getah (Gum)', 'Meliputi usaha industri kimia dasar organik yang menghasilkan bahan kimia dari kayu, dan getah (gum), seperti: minyak gondorukem, kemenyan, gambir, kapur barus, damar, rosin, terpentin, tall oil, pine oil,asam asetat,wood creosote dan charcoal (arang kayu'),
('1251', 'D', '24', '241', '2411', '24116', '5', 'Industri Kimia Dasar Organik, Hasil Antara Siklis, Zat Warna dan Pigmen ', 'Meliputi usaha industri kimia dasar yang menghasilkan bahan kimia organik, zat warna dan pigment dengan hasil antara siklisnya, seperti: hasil antara phenol dan turunannya, zat warna tekstil dan zat warna untuk makanan/ obat-obatan .'),
('1252', 'D', '24', '241', '2411', '24117', '5', 'Industri Kimia Dasar Organik, yang Bersumber dari Minyak Bumi dan Gas Bumi Serta dari Batu Bara', 'Meliputi usaha industri kimia dasar organik yang menghasilkan bahan kimia yang bahan bakunya berasal dari minyak bumi dan gas bumi maupun batu-bara, seperti: etilena, propilena, benzena, toluena, caprolactam termasuk pengolahan coal-tar.'),
('1253', 'D', '24', '241', '2411', '24118', '5', 'Industri Kimia Dasar Organik, yang Menghasilkan Bahan Kimia Khususnya (Specialty Chemicals)', 'Meliputi usaha industri kimia dasar organik yang menghasilkan bahan kimia khusus seperti: bahan kimia khusus untuk minyak dan gas bumi, pengolahan air, karet, kertas, konstruksi, automotive, bahan tambahan makanan (food additive), tekstil, kulit, elektron'),
('1254', 'G', '53', '534', '5349', '53490', '5', 'Perdagangan Ekspor Produk Antara (Intermediate product)', 'Meliputi usaha mengekspor barang-barang antara, barang-barang bekas, dan sisa-sisa tak terpakai, seperti: barang-barang kimia dasar, pupuk, bahan dasar plastik tekstil fiber.');
INSERT INTO `dd_klui` (`ID_KLUI`, `ID_KLUI_KATEGORI`, `GP`, `GOL`, `SUB`, `KEL`, `LVL`, `JUDUL`, `URAIAN`) VALUES
('1255', 'D', '24', '241', '2411', '24119', '5', 'Industri Kimia Dasar Organik, yang Tidak Diklasifikasikan di Tempat Lain', 'Meliputi usaha industri kimia dasar organik yang belum tercakup dalam golongan industri kimia dasar organik tersebut diatas, seperti: macam-macam pelarut (kecuali alkohol) ester,asam-asam organik, bahan untuk bahan baku pestisida, zat aktip permukaan, bah'),
('1256', 'D', '24', '241', '2412', NULL, '4', 'Industri Pupuk', NULL),
('1257', 'D', '24', '241', '2412', '24121', '5', 'Industri Pupuk Alam / Non Sintetis', 'Meliputi usaha pembuatan pupuk alam yang berasal dari batuan maupun bukan batuan, seperti: pupuk fosfat, pupuk kapur, pupuk kompos, pupuk kandang, pupuk dolomit, dan chilisalpeter.'),
('1258', 'D', '24', '241', '2412', '24122', '5', 'Industri Pupuk Buatan Tunggal', 'Meliputi usaha pembuatan pupuk buatan tunggal, seperti: Urea, ZA, TSP, DSP, dan kalium sulfat.Termasuk juga pembuatan gas CO2, asam sulfat, amoniak, asam fosfat dan asam nitrat yang berkaitan dengan pembuatan pupuk dan tidak dapat dilaporkan secara terpis'),
('1259', 'D', '24', '241', '2412', '24123', '5', 'Industri Pupuk Buatan Majemuk dan Campuran', 'Meliputi usaha pembuatan pupuk buatan majemuk dan pupuk buatan campuran, seperti: mono amonium phosphat (MAP), kalium meta phosphat, diamonium phosphat (DAP), nitrogen phosphat kalium (NPK), nitrogen fosfat (NP), dan fosfat kalium (PK).'),
('1260', 'D', '24', '241', '2412', '24129', '5', 'Industri Pupuk Lainnya', 'Meliputi usaha pembuatan pupuk yang belum termasuk dalam golongan manapun, seperti pupuk pelengkap cair (PPC).'),
('1261', 'D', '24', '241', '24123', NULL, '4', 'Industri Plastik dan Karet Buatan', NULL),
('1262', 'D', '24', '241', '24123', '24131', '5', 'Industri Damar Buatan (Resin Sintetis) dan Bahan Plastik', 'Meliputi usaha pembuatan damar buatan dan bahan plastik, seperti: alkid, poliester, aminos, poliamid, epoksid, silikon poliuretan, polietilen, polipropilen, polistiren, polivinil klorid, selulosa asetat, dan solulosa nitrat. Pengolahan lanjutan dari damar'),
('1263', 'D', '24', '241', '24123', '24132', '5', 'Industri Karet Buatan ', 'Meliputi usaha pembuatan karet bauatan seperti: styrene butadiene rubber (SBR), polikhloropren (Neopren), acryilonitrile butadine rubber (nitrile rubber), silicone rubber (polysiloxane) dan isoprene rubber.'),
('1264', 'D', '24', '242', NULL, NULL, '3', 'INDUSTI BARANG-BARANG KIMIA LAINNYA', NULL),
('1265', 'D', '24', '242', '2421', NULL, '4', 'Industri Bahan Baku Pemberantas Hama, dan Pemberantas Hama, termasuk Zat Pengatur Tumbuh', NULL),
('1266', 'D', '24', '242', '2421', '24211', '5', 'Industri Bahan Baku Pemberantas Hama (bahan aktif)', 'Meliputi usaha pembuatan bahan baku untuk pestisida seperti: buthyl phenyl methyl carbamat (BPMC), methyl isopropyl carbamat (MIPC), diazinon, carbofuran, glyphosate, monocrotophos, arsentrioxyde dan copper sulphte'),
('1267', 'D', '24', '242', '2421', '24212', '5', 'Industri Pemberantas Hama Formulasi', 'Meliputi usaha pengolahan bahan aktif menjadi pemberantas hama (pestisida) dalam bentuk siap dipakai seperti: insektisida, fungisida, rodentisida, herbisida, nematisida, molusida dan akarisida.'),
('1268', 'D', '24', '242', '2421', '24213', '5', 'Industri Zat Pengatur Tubuh', 'Meliputi usaha pengolahan bahan kimia menjadi zat pengatur tubuh, seperti: atonik, ethrel, cepha, dekamon, mixtalol, hidrasil dan sitozim'),
('1050', 'O', '92', '924', '9242', '92423', '5', 'Kolam Pemancingan', 'Meliputi suatu usaha yang menyediakan tempat dan fasilitas untuk memancing ikan sebagai usaha pokok dan dapat dilengkapi dengan penyediaan jasa pelayanan makan dan minum.'),
('728', 'J', '65', '651', '6511', NULL, '4', 'Bank Sentral', NULL),
