('730', 'J', '65', '651', '6512', NULL, '4', 'Bank Umum', NULL),
('1650', 'D', '15', '153', '1531', '15318', '5', 'Industri Kopra', 'Meliputi usaha pembuatan kopra yang terpisah dari usaha pertaniannya. Kegiatan pembuatan kopra yang tidak dapat dipisahkan dari usaha  pertaniannya dimasukkan dalam golongan 011 (Pertanian).'),
('1309', 'D', '25', '252', '2520', '25205', '5', 'Industri Kemasan dari Plastik', 'Meliputi usaha pembuatan kemasan dari plastik, seperti: kantong plastik, karung plastik, kemasan kosmetik, kemasan film, kemasan obat, kemasan makanan dan kemasan lainnya dari plastik.'),
('1202', 'D', '21', '210', '2101', '21014', '5', 'Industri Kertas Khusus', 'Meliputi usaha pembuatan kertas khusus seperti: cardiopan, kertas litmus, metalic paper, acid proof paper, kertas pola, kertas bersalud, kertas celopan dan sejenisnya. Pengerjaan kertas yang melapisi dengan segala cara, seperti: coating, glazing, gumming '),
('1203', 'D', '21', '210', '2101', '21015', '5', 'Industri Kertas Industri', 'Meliputi usaha pembuatan kertas kontruksi (kertas isolasi, kondensor, roofing board, building board dan lain-lain). Kertas bungkus dan pengepakan  (kraftliner, medium liner/corrogating medium, ribbed kraft paper/kertas payung, kraft paper), board (post ca'),
('1204', 'D', '21', '210', '2101', '21016', '5', 'Industri Kertas Tissue', 'Meliputi usaha pembuatan kertas rumah tangga (towelling stock, napkins stock, facial tissue, toilet tissue, lens tissue). Kertas kapas, kertas sigaret, dan cork tipping paper.'),
('1205', 'D', '21', '210', '2101', '21019', '5', 'Industri Kertas Lainnya', 'Meliputi usaha pembuatan kertas selain kelompok 21011 s.d  21016, seperti kertas magnetik.'),
('1206', 'D', '21', '210', '2102', NULL, '4', 'Industri Kemasan dan Kotak, dari Kertas dan Karton', NULL),
('1207', 'D', '21', '210', '2102', '21020', '5', 'Industri Kemasan dan Kotak, dari Kertas dan Karton', 'Meliputi usaha pembuatan segala macam kemasan dan kotak dari kertas/karton yang digunakan untuk pembungkus/pengepakan, termasuk juga pembuatan kotak untuk rokok dan barang-barang lainnya. '),
('1208', 'D', '21', '210', '2109', NULL, '4', 'Industri Barang dari Kertas dan Karton yang Tidak Termasuk Dalam Sub Golongan Manapun', NULL),
('1209', 'D', '21', '210', '2109', '21090', '5', 'Industri Barang dari Kertas dan Karton yang Tidak Termasuk Dalam Sub Golongan Manapun', 'Meliputi usaha pembuatan barang dari kertas dan karton yang belum tercakup dalam sub golongan manapun. Termasuk di sini mengerjakan kertas dan karton dengan segala cara, seperti: coating, glazing, gumming, laminating, pembuatan kertas karbon dan kertas st'),
('1210', 'D', '22', NULL, NULL, NULL, '2', 'INDUSTRI PENERBITAN, PENCETAKAN DAN REPRODUKSI MEDIA REKAMAN', NULL),
