('1213', 'D', '22', '221', '2211', '22110', '5', 'Penerbitan Buku,Brosur, Buku Musik, dan Publikasi Lainnya', 'Meliputi usaha penerbitan buku, buku pelajaran, atlas/peta, brosur, pamflet, buku musik, dan publikasi lainnya.'),
('1214', 'D', '22', '221', '2212', NULL, '4', 'Penerbitan Surat kabar, Jurnal dan Majalah', NULL),
