('1216', 'D', '22', '221', '2213', NULL, '4', 'Penerbitan Dalam Media Rekaman', NULL),
('1217', 'D', '22', '221', '2213', '22130', '5', 'Penerbitan Dalam Media Rekaman', 'Meliputi usaha perekaman suara di piringan hitam, pita kaset, compact disc (CD) dan sejenisnya. Penerbitan rekaman film dan video termasuk subgolongan 9211 (Produksi dan distribusi film dan video). Penerbitan piranti lunak komputer termasuk subgolongan 72'),
('1218', 'D', '22', '221', '2219', NULL, '4', 'Industri Penerbitan Lainnya', NULL),
('1219', 'D', '22', '221', '2219', '22190', '5', 'Industri Penerbitan Lainnya', 'Meliputi usaha penerbitan foto-foto, grafir (engraving) dan kartu pos, formulir, poster, reproduksi, pencetakan lukisan, dan barang-barang cetakan lainnya. Industri ini termasuk pula rekaman dalam mikro film. '),
('1220', 'D', '22', '222', NULL, NULL, '3', 'INDUSTRI PERCETAKAN DAN KEGIATAN YANG BERKAITAN DENGAN PENCETAKAN ', NULL),
