('1223', 'D', '22', '222', '2222', NULL, '4', 'Industri Jasa Penunjang Percetakan', NULL),
('1224', 'D', '22', '222', '2222', '22220', '5', 'Industri Jasa Penunjang Percetakan', 'Meliputi usaha penjilidan buku. Produksi composed type, plates atau cylinders, penjilidan dan buku. Produksi batu lithographic, untuk digunakan dalam kegiatan pencetakan di unit lain.'),
('1225', 'D', '22', '223', NULL, NULL, '3', 'REPRODUKSI MEDIA REKAMAN', NULL),
('1226', 'D', '22', '223', '2230', NULL, '4', 'Reproduksi Media Rekaman', NULL),
('1227', 'D', '22', '223', '2230', '22301', '5', 'REPRODUKSI MEDIA REKAMAN', 'Meliputi usaha reproduksi (rekaman ulang) suara (audio), dan komputer dari master copies, rekaman ulang floppy, hard  dan compact disks. Pembuatan piringan hitam kosong, pita kaset kosong, pita komputer dan disket kosong untuk merekam data dimasukkan dala'),
('1228', 'D', '22', '223', '2230', '22302', '5', 'Reproduksi Film dan Video', 'Meliputi usaha reproduksi  (rekaman ulang) gambar film dan vidio. Penerbitan rekaman film dan video dimasukkan dalam subgolongan 9211 (Produksi dan distribusi film dan video).'),
('1229', 'D', '23', NULL, NULL, NULL, '2', 'INDUSTRI BATU BARA, PENGILANGAN MINYAK BUMI DAN PENGOLAHAN GAS BUMI, BARANG-BARANG DARI HASIL PENGILANGAN MINYAK BUMI, DAN BAHAN BAKAR NUKLIR', NULL),
