('1528', 'B', '5', '50', '501', '5012', '5', 'Penangkapan crustacea laut', 'Meliputi usaha/ penangkapan jenis udang ( seperti :udang windu, udang putih, udang dogol) lobster dan crustacea laut lainnya (seperti: udang,udang putih, udang dogol). Lobster dan crustacealaut lainnya (seperti: kepiting dan rajungan) di laut, muara sunga'),
