('1533', 'B', '5', '50', '502', '5021', '5', 'Budidaya biota laut', 'Meliputi usaha/ kegiatan budidaya/ pembesaran iakan, udang, kerang mutiara, kerang darah, kerang hijau, tripang dan binatang laut lainnya (seperti: penyu, kima raksasa, dan keong laut) di laut muara sungai, laugna, dan tempat lain yang di pengaruhi pasang'),
('1534', 'B', '5', '50', '502', '5022', '5', 'Pembenihan biota laut', 'Meliputi usaha pembenihan ikan laut,udang, dan biota laut lainnya (seperti: kerang mutiara, kerang hijau, penyu dan kepiting) dengan media air laut'),
