('1537', 'B', '5', '50', '503', '5032', '5', 'Penangkapan crustacea, mollusca, dan biota lainnya di perairan umum', 'Meliputi usaha/ kegiatan penangkapan crustacea air tawar (seperti: udang galah dan udang grago). Mollusca (seperti: siput dan remis). Katak dan biota air tawar lainnya (seperti: bulus, belut, dan sidat) didalam sungai waduk dan rawa.'),
