('1624', 'D', '15', '151', '1513', '15131', '5', 'Industri Pengalengan Buah-buahan dan Sayuran ', 'Meliputi usaha pengolahan dan pengawetan buah-buahan dan sayuran melalui proses pengalengan seperti: nanas dalam kaleng, rambutan dalam kaleng dan wortel dalam kaleng. Yang dimaksud pengalengan di sini merupakan proses pengawetan dan bukan hanya pengemasa'),
