('1626', 'D', '15', '151', '1513', '15133', '5', 'Industri Pelumatan Buah-buahan dan Sayuran ', 'Meliputi usaha pengawetan buah-buahan dan sayuran dengan proses pelumatan, baik dalam bentuk kemasan ataupun tidak, seperti : selai mangga, jelly murbai, sauce tomat, cabe giling dan sauce selada.'),
